#include "test_224.h"#include <iostream>#include <string>using namespace std;int main(int argc, char** argv){    Solution *solution = new Solution();    string str1 = " 1 + 2 + 3 + 4";    int ret1 = solution->calculate(str1);    if (ret1 == 10) {        cout << "ret1 ok" << endl;    }    string str2 = "3-(1+2)+4";    int ret2 = solution->calculate(str2);    if (ret2 == 4) {        cout << "ret2 ok" << endl;    }    string str3 = "(3*(0-2)+4)*3/6";    int ret3 = solution->calculate(str3);    if (ret3 == -1) {        cout << "ret3 ok" << endl;    }    return 0;}